import { GpsGateVersionInfo } from './gps-gate-version-info';
export interface GpsGateGpsInfo {
    satellites: {
        count: number;
        items: {
            prn: number;
            elevation: number;
            azimuth: number;
            snr: number;
            usedForFix: boolean;
        }[];
    };
    status: {
        permitted: boolean;
        valid: boolean;
    };
    trackPoint: {
        position: Coordinates;
        precision: {
            hdop: number;
        };
        velocity: {
            groundSpeed: number;
            heading: 0;
            magneticVariation: 0;
        };
        utc: string;
    };
    version: GpsGateVersionInfo;
}
